def input_into_scores(data)
  datas = Score.all
  dates = []

  datas.each do |d|
    dates << d.tanggal
  end

  unless dates.include? data.tanggal
    data.save!
    puts "INSERT: data zona #{data.tanggal} berhasil"
  else
    puts "INFO: data zona #{data.tanggal} sudah tersedia"
  end
end

